import React, { Component } from 'react'
import {Link } from 'react-router-dom';

export default class Nav extends Component {
  render() {
    return (
      <div>
        <ul>
            <Link>
            <li>About Us</li>
            </Link>
              <li>Home</li>
              <li>About Us</li>
              <li>Contact Us</li>
            </ul>
      </div>
    )
  }
}
